import React from 'react';
import './TrackList.css';
import List from '@mui/material/List';
import Track from '../Track/Track';

function TrackList({ tracks, onAddTrack, isRemovable, playlistTracks }) {
  return (
    <List className="tracklist">
      {tracks.map((track) => (
        <Track
          key={track.id}
          track={track}
          onAddTrack={onAddTrack} // Pass the onAddTrack function
          isRemovable={isRemovable} // Pass the isRemovable prop
          playlistTracks={playlistTracks}
        />
      ))}
    </List>
  );
}

export default TrackList;
